import React from 'react';
import Common from './Common';
import pic from "../images/code_thinking.png";
const Home = () =>{
    return (
        <>
        <Common name="Learn modern technologies with" imgsrc={pic} visit="/service" btname="Get Started" />

        </>
    );
};
export default Home;
